;; gorilla-repl.fileformat = 1

;; **
;;; # Color Maps
;;; 
;;; This short tutorial will show you how to change the color maps of loaded pictures. A colormap is defined by  a m-by-3 matrix of real numbers between 0.0 and 1.0. Each row is an RGB vector that defines one color.
;;; 
;;; This follows the story of kutsushita, the cat that likes to change color.
;; **

;; @@
; first we import the usual namespaces.
(ns affectionate-thorns
  (:require
    [opencv4.utils :as u]
    [opencv4.colors.rgb :as color]
    [opencv4.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Changing color space for a default color space is done through the function **apply-color-map!** from opencv4.core 
;;; 
;;; The mat as well as the colormap id is passed as parameter.
;;; 
;;; Using the chaining method we can apply the *BONE* color map using the code below:
;; **

;; @@
(-> "resources/images/cats/onsofa.jpg" 
  imread  
  (u/resize-by 0.5)
  (apply-color-map! COLORMAP_BONE )
  (u/mat-view))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"200\" height=\"271\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4b13fb44 \"BufferedImage@4b13fb44: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 200 height = 271 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; You just saw one colormap, but a few other default color maps are available by default. The array below is a list of all the available color maps through OpenCV core. 
;; **

;; @@
(def colors-maps
[
 "COLORMAP_HOT"
 "COLORMAP_HSV"
 "COLORMAP_JET"
 "COLORMAP_BONE"
 "COLORMAP_COOL"
 "COLORMAP_PINK"
 "COLORMAP_RAINBOW"
 "COLORMAP_OCEAN"
 "COLORMAP_WINTER"
 "COLORMAP_SUMMER"
 "COLORMAP_AUTUMN"
 "COLORMAP_SPRING"])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;affectionate-thorns/colors-maps</span>","value":"#'affectionate-thorns/colors-maps"}
;; <=

;; @@
(defn watermark [ source text]
  (put-text! source
    text
    (new-point 30 30) FONT_HERSHEY_PLAIN 1 (new-scalar 255 255 255) 2))

(defn change-color [ source color-map-string ]
  (->
  source
  clone
  (apply-color-map! (eval (read-string (str "opencv4.core/" color-map-string))))
  (watermark color-map-string)))

(defn apply-all-colormaps [ source ] 
   (cons
    (-> source clone (watermark "ORIGINAL"))
    (map (partial change-color source) colors-maps)) )
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;affectionate-thorns/apply-all-colormaps</span>","value":"#'affectionate-thorns/apply-all-colormaps"}
;; <=

;; @@

(def source 
  (-> "http://sites.psu.edu/siowfa15/wp-content/uploads/sites/29639/2015/10/cat.jpg"
    (u/mat-from-url)
    (u/resize-by 0.1)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;affectionate-thorns/source</span>","value":"#'affectionate-thorns/source"}
;; <=

;; @@
(def targets (apply-all-colormaps source))
(u/mat-view (vconcat! targets))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"1404\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x756f2d97 \"BufferedImage@756f2d97: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 1404 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; Defining your own color space is also possible using the function **transform!**. transform needs a matrix doing the mapping from rgb to some mapping. 
;;; The first line of the matrix is the blue value, the second line is the green value, the third value is the red value. 
;;; 
;;; The below matrix makes so that all red pixels are turned to green. 
;; **

;; **
;;; 
;; **

;; @@

(def custom (u/matrix-to-mat [
  [1 0 0] ; blue
  [0 1 0] ; green 
  [0 1 0] ; red
  ]))

(-> img
  clone
  (transform!  custom)
  (u/mat-view ))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"200\" height=\"271\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7fd1bb44 \"BufferedImage@7fd1bb44: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 200 height = 271 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; You could use the same technique to define your own sepia filter.
;; **

;; @@

(def img (-> "resources/images/cats/onsofa.jpg" imread (u/resize-by 0.5)))

(def blue-sepia (u/matrix-to-mat [
  [0.393 0.769 0.189] ; blue
  [0.349 0.686 0.168] ; green
  [0.272 0.534 0.131] ; red
  ]))

(-> img
  clone
  (transform!  blue-sepia)
  (u/mat-view ))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"200\" height=\"271\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7fab8aab \"BufferedImage@7fab8aab: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 200 height = 271 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; And a regular sepia is done using a similar matrix.
;; **

;; @@
(def sepia-2 (u/matrix-to-mat [
  [0.131 0.534 0.272]
  [0.168 0.686 0.349]
  [0.189 0.769 0.393]
  ]))

(-> img
  clone
  (transform!  sepia-2)
  (u/mat-view ))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"200\" height=\"271\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2e88b9eb \"BufferedImage@2e88b9eb: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 200 height = 271 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=
